// src/App.jsx  
import React, { useState, Suspense } from 'react';  
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';  
import Home from './components/Home';  
import Winners from './components/Winners';  
import PastWinners from './components/PastWinners';  
import Navbar from './components/Navbar';  
import Footer from './components/Footer';  
import WalletConnect from './components/WalletConnect';  
 
  
const App = () => {  
  // ... (Wallet connection logic remains the same)  
  
  return (  
    <Router>  
      <div className="min-h-screen bg-gradient-to-r from-purple-400 to-blue-500"> {/* Background gradient */}  
        <Navbar />  
        <div className="container mx-auto px-4 py-8"> {/* Container for main content */}  
          <Suspense fallback={<div className="text-center p-4">Loading...</div>}>  
            <Routes>  
              <Route path="/" element={<Home walletAddress={walletAddress} />} />  
              <Route path="/winners" element={<Winners />} />  
              <Route path="/past-winners" element={<PastWinners />} />  
            </Routes>  
          </Suspense>  
        </div>  
        <Footer />  
        {renderConfetti()}  
      </div>  
    </Router>  
  );  
};  
  
export default App;
